ther proceeding involving the ownership, scope, validity or enforceability of any patents or other intellectual property owned by Seller or any Affiliate of Seller.  Buyer shall notify Seller promptly after becoming aware of any IP Claim. No Party or other person or entity shall be entitled to any form of equitable or implied indemnification at any time with respect to any such IP Claims.\",\"Identifier\":56444,\"DisplayName\":\"Document Version Clause Section\",\"EntityName\":\"DocumentVersionClauseSection\",\"EntityTypeId\":\"115E6309-361C-40F2-BE7E-DF1623B9C060\",\"HasWorkFlow\":false,\"AreInstancesShared\":true,\"MaintainEntityInstanceVersions\":false,\"AuditLog\":[],\"IsPrivate\":false,\"ETag\":\"2018-07-16T10:43:18.253\",\"IsActive\":\"1\",\"OrgPath\":null,\"OrgPathId\":\"e34b2abb-5752-8771-abb7-f32cc056beb6\",\"ParentId\":\"00000000-0000-0000-0000-000000000000\",\"SharedOrgPathId\":\"00000000-0000-0000-0000-000000000000\",\"IsDeprecated\":false,\"SysId\":\"0f5d1e9c-fe4b-410b-aecf-c1299bd40687\",\"ExtensionAttributes\":null,\"Version\":1,\"WorkflowInstanceId\":null}],\"DisplayName\":\"Document Version Clause\",\"EntityName\":\"DocumentVersionClause\",\"EntityTypeId\":\"2532476A-C3FB-41CE-93A9-4A8C8F66577F\",\"HasWorkFlow\":false,\"AreInstancesShared\":true,\"MaintainEntityInstanceVersions\":false,\"AuditLog\":[],\"IsPrivate\":false,\"ETag\":\"2018-07-16T10:43:18.127\",\"IsActive\":\"1\",\"OrgPath\":null,\"OrgPathId\":\"e34b2abb-5752-8771-abb7-f32cc056beb6\",\"ParentId\":\"00000000-0000-0000-0000-000000000000\",\"SharedOrgPathId\":\"00000000-0000-0000-0000-000000000000\",\"IsDeprecated\":false,\"SysId\":\"45a55f1d-fe93-499d-bba9-520221ab0cbb\",\"ExtensionAttributes\":null,\"Version\":1,\"WorkflowInstanceId\":null},{\"IsDeviated\":false,\"ExpiryDate\":\"2018-04-19T00:00:00\",\"EffectiveDate\":\"2018-04-19T00:00:00\",\"StandardClauseInstanceId\":\"658103f3-53bf-44ff-a318-5ff14aeff560\",\"StandardClauseVersion\":0,\"Identifier\":53750,\"DocumentVersionClauseSectio