cc056beb6\",\"ParentId\":\"00000000-0000-0000-0000-000000000000\",\"SharedOrgPathId\":\"00000000-0000-0000-0000-000000000000\",\"IsDeprecated\":false,\"SysId\":\"46d535ae-65c1-46ec-953b-5e6ab74c3fcf\",\"ExtensionAttributes\":null,\"Version\":1,\"WorkflowInstanceId\":null},{\"IsDeviated\":false,\"ExpiryDate\":\"2018-07-06T00:00:00\",\"EffectiveDate\":\"2018-07-06T00:00:00\",\"StandardClauseInstanceId\":\"0b9d69aa-b7b5-4b57-b808-b6ab58d106d5\",\"StandardClauseVersion\":0,\"Identifier\":53762,\"DocumentVersionClauseSections\":[{\"SectionNumber\":1,\"ClauseText\":\"Warranties, Conditions and Disclaimers.Product Warranties and Disclaimers.  Seller warrants to Buyer that at the time of transfer of risk in accordance with agreed upon Incoterm the Product shall (i) be free of any defects of title; (ii) be in the agreed quantity and (iii) complies with the Specifications.  To the fullest extent not prohibited by Applicable Laws, Seller expressly disclaims all other representations, warranties or conditions or guarantees of any kind, whether express or implied, written or oral, by fact or law, including any implied warranties, representations or conditions of merchantability, fitness for a particular purpose, satisfactory quality, non-infringement, and any representations or warranties or conditions or guarantees arising from statute, course of dealing or usage of trade.Product Inspection and Notice.  Buyer shall inspect the Product supplied hereunder immediately after delivery.  Except with respect to claims for shortages, Buyer shall give notice to Seller of any claim (i) within thirty (30) days after the date of delivery in the case of obvious defects and (ii) within thirty (30) days from the date of discovery in the case of latent defects but in any event no later than one(1) year after receipt of the Product.All claims by Buyer shall be made by written notice toSeller in accordance with the provisions of this Section “Warranties, Conditions and Disclaimers”, Sections “Limitation of Liability” and “Limitation of Action” of this Contract.The Products supplied shall otherwise be considered free of defects and any failure to give notice within such time periods shall constitute unqualified acceptance of the Product and a waiver by Buyer of all claims with respect thereto.Claims for Shortages and Transportation Damage.  Claims for shortages must be received by Seller in writing within forty-eight (48) hours after delivery of the relevant Product units.Seller shall be given a reasonable opportunity to inspect any shipment claimed by Buyer to contain a shortage.In case of any transportation damage Buyer shall make all reservations to the carrier to ensure that Seller’s rights (if any) towards carrier are secured.Additional Disclaimers.With regard to any handling of any Product, Buyer assumes full responsibility for quality control, testing and determination of suitability of Product for its intended application or use.Seller further makes no warranty, representation, condition or guarantee, either express or implied, in respect of any technical advice furnished or other recommendations made by Seller or its representatives concerning any use or application of any Product or for any Products made to the specifications provided by Buyer, and Seller expressly disclaims all warranties, representations and conditions of sufficiency, completeness, suitability and accuracy and in respect of the results to be obtained.Unauthorized Actions.   Any attempt to remedy or correct a claimed defect by persons or entities not authorized to perform such work by Seller or continued use of such Product shall void the Product warranties set forth above and Buyer shall be deemed to have accepted the Product as is, with no further obligation of Seller to Buyer.  If requested by Seller, Buyer shall return the nonconforming Product to Seller strictly in accordance with Seller’s written instructionsconcerning shipping, handling, insurance, and other matters as to which Seller issues instructions.Seller shall pay the costs only if it establishes that the Product unit was defective at the time of delivery to Buyer.Failure to comply with these provisions shall invalidate any claim by Buyer for breach of warranty.\",\"Identifier\":56443,\"DisplayName\":\"Document Version Clause Section\",\"EntityName\":\"DocumentVersionClauseSection\",\"EntityTypeId\":\"115E6309-361C-40F2-BE7E-DF1623B9C060\",\"HasWorkFlow\":false,\"AreInstancesShared\":true,\"MaintainEntityInstanceVersions\":false,\"AuditLog\":[],\"IsPrivate\":false,\"ETag\":\"2018-07-16T10:43:18.253\",\"IsActive\":\"1\",\"OrgPath\":null,\"OrgPathId\":\"e34b2abb-5752-8771-abb7-f32cc056beb6\",\"ParentId\":\"00000000-0000-0000-0000-000000000000\",\"SharedOrgPathId\":\"00000000-0000-0000-0000-000000000000\",\"IsDeprecated\":false,\"SysId\":\"fe4af4f3-2297-44a4-8c7d-5f32abc0ca7b\",\"ExtensionAttributes\":null,\"Version\":1,\"WorkflowInstanceId\":null}],\"DisplayName\":\"Document Version Clause\",\"EntityName\":\"DocumentVersionClause\",\"EntityTypeId\":\"2532476A-C3FB-41CE-93A9-4A8C8F66577F\",\"HasWorkFlow\":false,\"AreInstancesShared\":true,\"MaintainEntityInstanceVersions\":false,\"AuditLog\":[],\"IsPrivate\":false,\"ETag\":\"2018-07-16T10:43:18.127\",\"IsActive\":\"1\",\"OrgPath\":null,\"OrgPathId\":\"e34b2abb-5752-8771-abb7-f32cc056beb6\",\"ParentId\":\"00000000-0000-0000-0000-000000000000\",\"SharedOrgPathId\":\"00000000-0000-0000-0000-000000000000\",\"IsDeprecated\":false,\"SysId\":\"461ffefb-f438-4669-bfdf-5f428a80c687\",\"ExtensionAttributes\":null,\"Version\":1,\"WorkflowInstanceId\":null},{\"IsDeviated\":false,\"ExpiryDate\":\"2018-07-02T00:00:00\",\"EffectiveDate\":\"2018-07-02T00:00:00\",\"StandardClauseInstanceId\":\"8e89ad78-9568-428b-8ea8-fc02c4a32ecf\",\"StandardClauseVersion\":0,\"Identifier\":53769,\"DocumentVersionClauseSections\":[{\"SectionNumber\":1,\"ClauseText\":\"Survival.   In order that the Parties may fully exercise their rights and perform their obligati